import { useEffect, useRef, useState } from 'react';
import { useSongs } from '../context/SongContext';

export default function PlayerBar() {
    const audioRef = useRef();
    const {
        current,
        queue,
        next,
        prev,
        playFromQueue,
        removeFromQueue,
        clearQueue,
        canGoToPrev,
        isQueueActive,
        currentIndex,
        switchToQueueMode,
        switchToAllSongsMode
    } = useSongs();

    const [isPlaying, setIsPlaying] = useState(false);
    const [progress, setProgress] = useState(0);
    const [duration, setDuration] = useState(0);
    const [currentTime, setCurrentTime] = useState(0);
    const [showQueue, setShowQueue] = useState(false);

    useEffect(() => {
        if (current && audioRef.current) {
            setProgress(0);
            setIsPlaying(false);
            audioRef.current.currentTime = 0;
            audioRef.current.load();

            const playPromise = audioRef.current.play();
            if (playPromise !== undefined) {
                playPromise.then(() => setIsPlaying(true)).catch(() => setIsPlaying(false));
            }
        }
    }, [current]);

    useEffect(() => {
        const audio = audioRef.current;
        if (!audio) return;

        const updateProgress = () => {
            if (audio.duration) {
                setCurrentTime(audio.currentTime);
                setDuration(audio.duration);
                const percent = (audio.currentTime / audio.duration) * 100;
                setProgress(percent || 0);
            }
        };

        const handleLoadStart = () => {
            setProgress(0);
            setDuration(0);
            setCurrentTime(0);
        };

        audio.addEventListener('timeupdate', updateProgress);
        audio.addEventListener('loadstart', handleLoadStart);

        return () => {
            audio.removeEventListener('timeupdate', updateProgress);
            audio.removeEventListener('loadstart', handleLoadStart);
        };
    }, [current]);

    const togglePlayPause = () => {
        const audio = audioRef.current;
        if (!audio) return;

        if (audio.paused) {
            audio.play();
            setIsPlaying(true);
        } else {
            audio.pause();
            setIsPlaying(false);
        }
    };

    const handleSeek = (e) => {
        const percent = e.target.value;
        const audio = audioRef.current;
        if (!audio) return;
        audio.currentTime = (percent / 100) * audio.duration;
        setProgress(percent);
    };

    const handlePrev = () => {
        const currentTime = audioRef.current?.currentTime || 0;
        prev(currentTime, () => {
            if (audioRef.current) {
                audioRef.current.currentTime = 0;
                setProgress(0);
            }
        });
    };

    const handleNext = () => {
        next();
    };

    const formatTime = (time) => {
        if (!time || isNaN(time)) return '0:00';
        const minutes = Math.floor(time / 60);
        const seconds = Math.floor(time % 60).toString().padStart(2, '0');
        return `${minutes}:${seconds}`;
    };

    if (!current) return null;

    return (
        <div style={{
            position: 'fixed',
            bottom: 0,
            width: '100%',
            background: '#111',
            color: '#fff',
            padding: '10px 15px',
            zIndex: 1000,
            boxShadow: '0 -2px 10px rgba(0,0,0,0.5)',
        }}>
            <audio ref={audioRef} onEnded={handleNext}>
                <source src={`https://lorelei-music-production.up.railway.app${current.audioUrl}`} type="audio/mpeg" />
            </audio>

            <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                <div>
                    <strong>{current.title}</strong> - {current.artist}
                    <div style={{ color: '#ccc', fontSize: '12px' }}>
                        {formatTime(currentTime)} / {formatTime(duration)}
                    </div>
                </div>
                <div style={{ display: 'flex', gap: 6 }}>
                    {queue.length > 0 && (
                        <div style={{ textAlign: 'center', marginRight: '10px' }}>
                            <div style={{ fontSize: '11px', color: '#ccc', marginBottom: 2 }}>
                                Mode: {isQueueActive ? 'Queue' : 'All Song'}
                            </div>
                            <button
                                onClick={() => isQueueActive ? switchToAllSongsMode() : switchToQueueMode()}
                                title='Ganti Mode'
                                style={{
                                    background: '#333',
                                    color: '#fff',
                                    border: 'none',
                                    padding: '5px 10px',
                                    borderRadius: 4,
                                    cursor: 'pointer',
                                    fontSize: '12px'
                                }}
                            >
                                {isQueueActive ? 'All Song' : 'Queue'}
                            </button>
                        </div>
                    )}
                    <button onClick={() => setShowQueue(!showQueue)} title="Queue"
                        style={{
                            background: '#333',
                            border: 'none',
                            borderRadius: 4,
                            padding: '5px 10px',
                            cursor: 'pointer',
                            color: '#fff',
                            marginRight: '25px'
                        }}>
                        {showQueue ? '✖ Close' : '≡ Queue'}
                    </button>
                </div>
            </div>

            {/* FUTURISTIC PROGRESS BAR */}
            <input
                type="range"
                min="0"
                max="100"
                value={progress}
                onChange={handleSeek}
                style={{
                    width: '100%',
                    marginLeft: '-15px',
                    marginTop: 10,
                    appearance: 'none',
                    height: 8,
                    borderRadius: 10,
                    background: 'linear-gradient(to right, #00fff2, #004dff)',
                    outline: 'none',
                    cursor: 'pointer',
                    boxShadow: '0 0 4px #00fff2',
                    WebkitAppearance: 'none',
                    MozAppearance: 'none',
                    position: 'relative'
                }}
                className="slider"
                onMouseMove={(e) => e.stopPropagation()}
            />

            <style>{`
                input.slider::-webkit-slider-thumb {
                -webkit-appearance: none;
                appearance: none;
                width: 64px;
                height: 64px;
                background: url('data:image/svg+xml;base64,') no-repeat center;
                background-size: contain;
                border: none;
                cursor: pointer;
                margin-top: -30px;
                }

                input.slider::-moz-range-thumb {
                width: 64px;
                height: 64px;
                background: url('data:image/svg+xml;base64,') no-repeat center;
                background-size: contain;
                border: none;
                cursor: pointer;
                }

            `}</style>

            <div style={{
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                marginTop: 10,
                gap: 20
            }}>
                <button onClick={handlePrev} title="Prev" style={{ background: 'transparent', border: 'none', cursor: 'pointer' }}>
                    <svg width="28" height="28" fill="#00fff2" viewBox="0 0 24 24">
                        <path d="M6 19V5h2v14H6zm3-7l9 7V5l-9 7z" />
                    </svg>
                </button>

                <button onClick={togglePlayPause} title={isPlaying ? 'Pause' : 'Play'} style={{ background: 'transparent', border: 'none', cursor: 'pointer' }}>
                    {isPlaying ? (
                        <svg width="32" height="32" fill="#00fff2" viewBox="0 0 24 24">
                            <path d="M6 19h4V5H6v14zm8-14v14h4V5h-4z" />
                        </svg>
                    ) : (
                        <svg width="32" height="32" fill="#00fff2" viewBox="0 0 24 24">
                            <path d="M8 5v14l11-7z" />
                        </svg>
                    )}
                </button>

                <button onClick={handleNext} title="Next" style={{ background: 'transparent', border: 'none', cursor: 'pointer' }}>
                    <svg width="28" height="28" fill="#00fff2" viewBox="0 0 24 24">
                        <path d="M16 5v14h2V5h-2zm-2 7l-9 7V5l9 7z" />
                    </svg>
                </button>
            </div>

            {showQueue && (
                <div style={{
                    marginTop: 10,
                    background: '#222',
                    padding: 10,
                    borderRadius: 5,
                    maxHeight: 200,
                    overflowY: 'auto'
                }}>
                    <div style={{
                        display: 'flex',
                        justifyContent: 'space-between',
                        alignItems: 'center',
                        marginBottom: 10
                    }}>
                        <h4 style={{ margin: 0 }}>Queue ({queue.length})</h4>
                        {queue.length > 0 && (
                            <button
                                onClick={clearQueue}
                                style={{
                                    background: '#ff4444',
                                    color: 'white',
                                    border: 'none',
                                    padding: '4px 8px',
                                    borderRadius: 4,
                                    cursor: 'pointer',
                                    fontSize: '12px'
                                }}
                            >
                                🗑️ Clear All
                            </button>
                        )}
                    </div>

                    {queue.length === 0 ? (
                        <p style={{ fontStyle: 'italic', margin: 0 }}>Queue kosong</p>
                    ) : (
                        <ul style={{ listStyle: 'none', padding: 0, margin: 0 }}>
                            {queue.map((song, index) => (
                                <li key={`${song._id}-${index}`} style={{
                                    padding: '8px 10px',
                                    cursor: 'pointer',
                                    background: (isQueueActive && currentIndex === index) ? '#444' : 'transparent',
                                    borderRadius: 4,
                                    marginBottom: 4,
                                    display: 'flex',
                                    justifyContent: 'space-between',
                                    alignItems: 'center'
                                }} onClick={() => playFromQueue(index)}>
                                    <span style={{ flex: 1 }}>
                                        {song.title} - {song.artist}
                                    </span>
                                    <button
                                        onClick={(e) => {
                                            e.stopPropagation();
                                            removeFromQueue(song._id, index);
                                        }}
                                        style={{
                                            background: 'transparent',
                                            border: 'none',
                                            color: '#ff4444',
                                            cursor: 'pointer',
                                            fontSize: '16px'
                                        }}
                                        title="Remove"
                                    >
                                        ❌
                                    </button>
                                </li>
                            ))}
                        </ul>
                    )}
                </div>
            )}
        </div>
    );
}
